import React from "react";
import { useParams } from "react-router-dom";
import tour from '../DB/Tuscany.json';
import leftarrow from '../assets/home/icons/test_left.svg';
import rightarr from '../assets/home/icons/Tours'

export const GalleryPlaces = () => {
    const { id } = useParams(); 
    const gallery = tour.find((gallery) => gallery.id === parseInt(id));

    // Check if gallery is undefined
    if (!gallery) {
        return <p>Gallery not found</p>;
    }

    const { img1, img2, img3, img4, img5, img6, img7 } = gallery;

    return(
        <section>
            <section className='carousel_header'>
                <h3>Gallery</h3>
                <section className="arrows">
        <button className="prev_btn">
            <img src={leftarrow}/>
        </button>
        <button className="next_btn"> 
            <img src={rightarr}/>
        </button>
    </section> 
            </section>
            <section className='carousel_container' key={gallery.id}> 
                <img className='carousel_item large' src={img4} alt="place's image 1" />
                <img className='carousel_item top-small' src={img5} alt="place's image 2" />
                <img className='carousel_item bottom-small' src={img6} alt="place's image 3" />
                <img className='carousel_item full' src={img7} alt="place's image 4" />
            </section>
        </section>
    );
}
